window.bookSummaryJSON = "<p>I've done some stupid things in my time. I've been reckless. I've broken a few rules. But never before have I ruined so many lives or left such a trail of destruction behind me. </p> <p>As Max would be the first to admit, she's never been one for rules. They tend to happen to other people. But this time she's gone too far, and everyone is paying the price. Grounded until the end of time, how can she ever put things right? </p>"; 
